//Khởi tạo thư viện icon của riêng bạn
import { library } from '@fortawesome/fontawesome-svg-core'; 

//Import các icon mà bạn muốn sử dụng trong từng gói
// import { faCode, faHighlighter } from '@fortawesome/free-solid-svg-icons';  
import { fab } from '@fortawesome/free-brands-svg-icons';
import { faStarHalfAlt, faMusic,faDotCircle,faChartLine,faHeadphones,faList,faMicrophone,faIcons,faGuitar} from '@fortawesome/free-solid-svg-icons';
// import {faGithub} from '@fortawesome/free-brands-svg-icons'
//Add các icon đã được import vào trong thư viện của bạn
library.add( fab,faStarHalfAlt, faMusic,faChartLine,faIcons,faMicrophone,faHeadphones,faGuitar,faList,faDotCircle);
